      <div class="commands-container">

         <h3 id="turn">TURN 1</h3>

         <div id="battles" class="commands-set">
            <h4 class="interactive"><img src="ressources/icons/swords.png" /> BATTLES</h4>
            <div class="hidable">
               <hr />
               <button id="btn-country-attacker" class="pressable">[Attacker]</button>
               <button id="btn-country-defender" class="pressable">[Defender]</button>
               <button id="btn-invert-attack">Invert</button><br />
               <label>Percentage</label><input type="text" id="perc" value="100" /><br />
               <button id="btn-battle">Battle</button>
            </div>
         </div>

         <div id="informations" class="commands-set">
            <h4 class="interactive"><img src="ressources/icons/notebook.png" /> INFORMATIONS</h4>
            <div class="hidable">
               <hr />
               <h4 id="country-field"></h4>
               <button id="btn-country-informations">Informations</button><button
                  id="btn-refresh-informations">Refresh</button>
               <div id="country-informations">
                  <table>
                     <tr>
                        <th>Population</th>
                        <td id="information-population"></td>
                     </tr>
                     <tr>
                        <th>Army</th>
                        <td id="information-army"></td>
                     </tr>
                     <tr>
                        <th>Territories</th>
                        <td id="information-territories"></td>
                     </tr>
                     <tr>
                        <th>Player</th>
                        <td id="information-player"></td>
                     </tr>
                  </table>
               </div>
            </div>
         </div>
         <div id="donation" class="commands-set">
            <h4 class="interactive"><img src="ressources/icons/donation.png" />DONATIONS</h4>
            <div class="hidable">
               <hr />
               <p id="notice" style="color:red;font-weight:bold;"></p>
               <button id="btn-country-donator" class="pressable">[Donor]</button>
               <button id="btn-country-receiver" class="pressable">[Receiver]</button>
               <button id="btn-invert-donation">Inverser</button><br />
               <label>Amount of soldiers</label><input type="text" id="soldiers-amount-donation" /><br />
               <label>Amount of territories</label><input type="text" id="territories-amount-donation" /><br />
               <input type="checkbox" id="cb-no-population-donation" /><label>Without population donation</label><br />
               <button id="btn-donation">Don</button>
            </div>
         </div>
         <div id="buttons" class="commands-set">
            <p id="pConsole"></p>
            <button id="btn-end-turn">End of turn</button>
            <button id="btn-save" disabled>Save</button>
            <button id="btn-download-image" disabled>Download PNG</button>
            <button id="copy-clipboard-players-informations">Players Informations</button>
            <button id="copy-clipboard-general-informations">General Informations</button>
         </div>
      </div>
